import React from "react";

import "./../../App.css";
import "./ChatRoom.css";

// COMPONENTS
import ChatSetup from "../../components/ChatSetup/ChatSetup";
import PageTitle from "../../components/PageTitle/PageTitle";
import BackArrow from "../../components/BackArrow/BackArrow";

export default function ChatRoom(props) {
  return (
    <div>
      <header>
        <BackArrow to="/discover" onClick={() => props.setSelectedUser("")} />
        {/* <ChatRoomHeading Component goes here */}
        <div>
          <div className="chat-room-title">
            <PageTitle title="Chat Room" />
          </div>
        </div>
      </header>
      <ChatSetup selectedUser={props.selectedUser} />
    </div>
  );
}
